Superman v2 #23-25
Publisher:  DC Comics
Publication Date:  November - December 1988

Writer:  Roger Stern
Penciller:  Mike Mignola (#23) and Kerry Gammill (#24-25)
Inker:  P. Craig Russell (#23) and John Beaty (#24-25)
Colorist:  Petra Scotese
Letterer:  John Costanza

Superman v2 #23
The Dark Knight Detective from Gotham City pays a visit to Clark Kent and brings with him an ominous warning. What does this warning have to do with Superman's enemy the Silver Banshee?

Superman v2 #24
A few months a go Dr. Kitty Faulkner was exposed to strange energy that transformed her into the monstrous Rampage. Now, a mad scientist bent on revenge, a former colleague of Kitty's, will attempt to use her ailment for his own nefarious schemes.

Superman v2 #25
Can even Superman survive when his two greatest adversaries--Lex Luthor and Brainiac--team up to destroy him once and for all? Can these two arch-villains play nice long enough to accomplish the task at hand?

Thanks goes to DreamGirl for this release.

